import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './component/Home';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path='/' component={<Home />} />
        </Routes>
      </BrowserRouter>

    </>
  );
}

export default App;
